import React from 'react'

export const AddPostPage = () => {
    return (
        <form onSubmit={(e) => e.preventDefault()}>
            <label>
                Прикрепить изорбажение:
                <input type='file' className='hidden'/>
            </label>
                    </form>
    )
}
